import './Landing.css'
import axios from 'axios'
import { API_KEY } from '../../constants/Constants'


function Landing() {
  const [landMovies,setLandMovies] = useState([])
  console.log("landMOvies",landMovies)

    useEffect(() => {
        axios.get(
          `https://api.themoviedb.org/3/discover/movie?api_key=${API_KEY}&with_genres=10749`
        ).then((res)=>{setLandMovies(res.data.results)})
    }, [])
    return (
        <div className ="land" >
            <h1>Unlimited movies, TV<br></br> shows and more.</h1>
            <p className ="sub-head">Watch anywhere. Cancel anytime.</p>
            <p className = "para">Ready to watch? Enter your email to create or restart your membership.</p>
            <div className ="form">
                <input type = "email" placeholder ="Email-Address"></input>
                <button className ="submit-btn">Get Started <i></i></button>
            </div>
        </div>
    )
}

export default Landing
